import React, { Component } from 'react';
import Card from "./card";
import img1 from "./Pictures/img1.jpg";
import img2 from "./Pictures/img2.jpg";
import list from './Pictures/list.json';

class Cardimp extends Component {
constructor(props){
    super(props)
    this.state = {Lists: []};
}

    fetchList = ()=> {
        fetch('./list.json')
        .then(rsp => rsp.json())
        .then((lists : Lists) => {
            this.state = lists;
        })
    }

 render(){
        return ( 



            <div className="container">
            <div className="container-fluid d-flex justify-content-center">
                <div className="row">
                    <div className="col-md-6">
                        <Card imageSrc={img1} title="Nature" text={list.map((listdata, id)=>{
                            return <div>
                                Starring:{listdata.starring}
                                </div>
                        })}/>
                    </div>

               </div>
                <div className="col-md-6">
                        <Card imageSrc={img2} title="Movies" text={list.map((listdata, index)=>{
                            return <div>
                               Description: {listdata.Movie_Name}
                                </div>
                        })}/>
                    </div>
                    <div className="col-md-6">
                        <Card imageSrc={img1} title="Movies" text={list.map((listdata, index)=>{
                            return <div>
                               Description: {listdata.starring}
                                </div>
                        })}/>
                    </div>
                    </div>
                    <div className="col-md-6">
                        <Card imageSrc={img1} title="Movies" text={list.map((listdata, index)=>{
                            return <div>
                               Description: {listdata.starring}
                                </div>
                        })}/>
            </div>
            </div>
         );
    }
}

export default Cardimp;
